package com.phoenix.spaceinvaders.entity.instance;

import java.applet.AudioClip;
import java.awt.Graphics;
import java.awt.Image;

import com.phoenix.spaceinvaders.SI;
import com.phoenix.spaceinvaders.entity.SIship;
import com.phoenix.util.ResourceUtil;

/**
 * Defines the fields holding the SI Base
 * 
 * @author William
 *
 */
public class SIbase extends SIship
{

    protected static final int defaultWidth = ResourceUtil.getInt( SIbase.class, "defaultWidth", 26 );
    protected static final int defaultHeight = ResourceUtil.getInt( SIbase.class, "defaultHeight", 20 );

    protected static final Image defaultAlive = ResourceUtil
            .getImage(
                    SIbase.class,
                    "SIbase.gif",
                    "" );

    protected static final Image defaultDestroyed = ResourceUtil
            .getImage(
                    SIbase.class,
                    "SIbaseBlast.gif",
                    "" );

    protected static final AudioClip defaultSound = ResourceUtil
            .getAudio(
                    SIbase.class,
                    "baseFire.wav",
                    "" );

    protected static final AudioClip defaultDestroySound = ResourceUtil
            .getAudio(
                    SIbase.class,
                    "SIshipHit.wav",
                    "" );

    public SIbase()
    {
        this( defaultAlive, defaultDestroyed, defaultSound, defaultDestroySound );
    }

    public SIbase( Image alive, Image destroyed, AudioClip sound, AudioClip destroySound )
    {
        this.alive = alive;
        this.destroyed = destroyed;
        this.sound = sound;
        this.destroySound = destroySound;
        init();
    }

    protected void init()
    {
        super.init();

        // Center
        xPosition = ( SI.width / 2 ) - ( width / 2 );
        yPosition = 375; // TODO better y value
    }

    public void playSound()
    {
        if ( sound != null ) sound.play();
    }

    /**
     * {@inheritDoc}
     */
    @Override
    public void paintComponent( Graphics g )
    {
        g.drawImage( visual, xPosition, yPosition, null );
    }

}
